import React, { Component } from "react";
//import $ from "jquery";

class events extends Component {
  componentDidMount() {
    //console.log($(".name").val());
  }
  render() {
    return (
      <div>
        <h1> Instagram Feed </h1>
        {/* <input className="name" value="Mau" /> */}
        <div id="instagram-feed1" className="instagram-feed"></div>
        <div id="pixlee_container"></div>
        {
          (window.PixleeAsyncInit = function () {
            Pixlee.init({ apiKey: "NL8pwjpze3no87mtHbLL" });
            Pixlee.addSimpleWidget({ widgetId: "31045" });
          })
        }
        <script src="//instafeed.assets.pxlecdn.com/assets/pixlee_widget_1_0_0.js"></script>
      </div>
    );
  }
}

export default events;
